// Import react
import React from 'react';

export function Home() {
    return (
        <div id="home" className="banner">

                <div className="center-text widget">

                    <div className="widget-card">

                        <h1 className="title">Quilts by Ginny</h1>

                        <h2 className="subtitle">Custom made by Virginia Frazier</h2>

                    </div>
                </div>

                <div className="page-button-div">
                    <a href="#quilts" className="page-button btn">
                        <button id="quilts-button">Quilts</button>
                    </a>
                </div>


            </div>
    )
}
